import React from "react";
import { Layout } from "../components";
import NavLayout from "../components/Recruitment/NavLayout";

const RecruitmentSettings = () => {
  return (
    <Layout>
      <NavLayout select="settings">
        <h1>Rahul</h1>
      </NavLayout>
    </Layout>
  );
};

export default RecruitmentSettings;
